import React from "react";
import { styled } from "@mui/material/styles";
import { Box, Container, Grid, List } from "@mui/material";
import Log from "../Home/asset/log.png";

const Logo = styled("img")(({ theme }) => ({
  width: "100px",
  fontSize: "70px",
  [theme.breakpoints.down("sm")]: {
    fontSize: "20px",
    width: "100px",
  },
}));

const Con = styled("div")(({ theme }) => ({
  fontFamily: "Roboto",
  fontsSize: "20px",
  fontWeight: 700,
  lineHeight: "26px",
  letterSpacing: "0em",

  [theme.breakpoints.down("sm")]: {
    fontSize: "20px",
    display: "none",
  },
}));

const Firstcon = styled("div")(({ theme }) => ({
  fontFamily: "Roboto",
  fontSize: "52px",
  fontWeight: 400,
  lineHeight: "68px",
  letterSpacing: "0em",
  position: "relative",
  top: "150px",

  [theme.breakpoints.down("sm")]: {
    fontFamily: "Roboto",
    fontSize: "26px",
    fontweight: 400,
    lineHeight: "34px",
    letterSpacing: "0em",
    textAlign: "center",
    position: "relative",
    top: "93px",
  },
}));
const Subcon = styled("div")(({ theme }) => ({
  fontFamily: "Roboto",
  fontSize: "24px",
  fontWeight: 400,
  lineHeight: "34px",
  letterSpacing: "0em",
  textAlign: "left",
  position: "relative",
  top: "150px",

  [theme.breakpoints.down("sm")]: {
    fontFamily: "Roboto",
    fontSize: "14px",
    fontWeight: 400,
    lineHeight: "21px",
    letterSpacing: "0em",
    textAlign: "center",
    position: "relative",
    top: "100px",
  },
}));

function Home() {
  return (
    <div>
      <Box
        sx={{
          height: "90px",
          maxWidth: "100%",
          backgroundColor: "red",
        }}
      >
        <Container>
          <Grid
            container
            sx={{
              position: "relative",
              top: "32px",
            }}
          >
            <Grid item xs={4} sm={0.1}></Grid>
            <Grid item xs={1} sm={5}>
              <Logo src={Log}></Logo>
            </Grid>
            <Grid item xs={5} sm={6}>
              <Con>contuct us</Con>
            </Grid>
          </Grid>
        </Container>
      </Box>
      <Box
        sx={{
          height: "600px",
          maxWidth: "100%",

          backgroundColor: "pink",
        }}
      >
        <Container>
          <Grid container>
            <Grid item xs={12} sm={6}>
              <Firstcon>MANAGEMENT & SERVICES COMPANY</Firstcon>

              <Subcon>
                We are a B2B & B2C startup company that strives for the best and
                understand what customers and business wants.
              </Subcon>
            </Grid>
            <Grid item xs={12} sm={1}></Grid>
            <Grid item xs={12} sm={5}>
              jjjjjjjj
            </Grid>
          </Grid>
        </Container>
      </Box>
    </div>
  );
}

export default Home;
